response.about:
Люблю я жить - пытаюсь уживаться;
Могу прощать, но не люблю прощаться;
Люблю курить и жизнью наслаждаться;
Спешу попасть, но не хочу попасться...
Люблю любовь - любовь без унижений;
Могу помочь - помочь без промедлений;
Могу соврать, но кто без пригрешений;
Могу забыть, но не терплю забвений...
